<!DOCTYPE HTML>
<html>
   <head>
	<style type="text/css">

		html, body, 
		.container{
		    padding: 0px;
		    margin: 0px;
		}

		.bike-container{
			display: inline-flex;
			width: 100%;
			background: #f7f7f7;
			margin: 0px 20px !important;
			padding: 0px !important;
		}

		h1,
		h2{
			/*text-shadow:0px 1px 1px #777777;*/
			font-size: 1.3em !important;
			margin: 20px 10px !important;
			font-weight: bold !important;
		}

		svg#bike{
			 margin-top: 0%;
			 height: 100vh;
			 background: white;
		}

		.bike-left{
			float: left;
			width: 70%;
			background: #f7f7f7;
		}

		.bike-right{
			float: right;
			width: 29%;
			margin-right: 0%;
			padding: 0%;
			background: white;
			box-shadow: -0px 0px 0px white;
			margin-top: 10px;
			border: 0.5px solid lightblue;
			margin-bottom: 7px;
			border-left: 0px solid white;
			box-sizing: border-box !important;
		}
		#handle{

		}

		.bike-right select{
			width: 97%;
			height: 40px;
			padding: 0px 15px ;
			border: 0px solid black;
			border-bottom: .5px solid grey;
			font-weight: 700 !important;
			border-radius: 5px;

		}


		.bike-right select:focus{
			outline: 0 !important;
			border: 0px solid black;
			border-top: 0px solid black;
			border-bottom: 0px solid black;


		}

		.bike-right select#hd:focus{
			border-bottom-right-radius: 0px !important;
			border-bottom-left-radius: 0px !important;
		}

		.bike-right select:last-child{
			border-top-right-radius: 0px !important;
			border-top-left-radius: 0px !important;
		}

		.bike-right select option{
			padding: 30px 0px !important;
			height: 50px !important;
			font-size: 1.2em;
			border: 0px !important;
			outline: 0 !important;
		}

		.bike-right select option:focus{
			outline: 0 !important;
			background: attr(value) !important;
		}

		#jsresults{
			width: 100% !important;
			text-align: center !important;
			font-size: 1.3em;
			letter-spacing: .08em;
		}

		.pad{
			margin: 5px 0px 20px 1%;
		}

		.bike-right #bikemaster{
			width: 80%;
			height: 40px;
			display: block;
			margin: 10px auto 20%;
			box-shadow: 2px 2px 3px #f5d5d5;
			border-radius: 5px;
			outline: none;
		}

		.bike-right #bikemaster::-moz-focus-inner{
			border: 0;
		}

		.bike-right #bikemaster:hover{
			background: #7777ff;
		}

		#elephant-copy{

			bottom: 85px;
			/*width: 25%;*/
			margin: auto;
			text-align: center;
		}



		@media screen and (max-width:815px){
			.bike-left, 
			.bike-right{
				width: 100%;
			}

			.bike-right{
				border: 0px solid grey;
				box-shadow:none;
			}

			svg#bike{
				margin-top:-5%;
				height: 400px;
			}

			.bike-container{
				display: block;
			}

			#bikemaster{
				width:  95%;
				margin: auto;
			}

			select.pad{

				margin: 10px auto !important;
				width: 98%;
			}
		}

	</style>
   </head>
